import { Navbar } from 'react-bootstrap'

const TopNav = props => {
  return(
    <Navbar>

      <Navbar.Header>
        <Navbar.Brand>
          <a href="#home">React-Bootstrap</a>
        </Navbar.Brand>
      </Navbar.Header>


    </Navbar>
  )
}

export default Navbar
